import React from "react";
import SkillChart from "../Components/SkillsChart" 

function SkillPage(props) {
    var dataPL = {
        datasets: [{
            data: [40,30,20,10],
            backgroundColor: ['Red','Yellow','Purple','Green'],
        }],
    
        // These labels appear in the legend and in the tooltips when hovering different arcs
        labels: [
            'Python',
            'Bash',
            'Java',
            'C'
        ],
        frontTitle: 'Programming \n Languages',
        options: 
            {legend: 
                {display: true, position: "bottom", labels:
                    {
                        fontColor:'#FFFFFF'
                    }
                }
            }
        }
    
    var softSkillsChartData = {
        datasets: [{
            data1: [40,30,20,10],
            data2: [12,30,50,20],
            backgroundColor: ['Red','Yellow','Purple','Green'],
        }],
    
        // These labels appear in the legend and in the tooltips when hovering different arcs
        labels: [
            'Python',
            'Bash',
            'Java',
            'C'
        ],
        frontTitle: 'Other Soft Skills',
        options: 
            {legend: 
                {display: true, position: "bottom", labels:
                    {
                        fontColor:'#FFFFFF'
                    }
                }
            }
        }


    return  (
        <div>
            <SkillChart
             chartDataPL = {dataPL}
             softSkillsChartData = {softSkillsChartData}
            />
        </div>

    )
}

export default SkillPage
